drop database if exists biblioteca;
CREATE DATABASE biblioteca;
use biblioteca;


create table inventario(
  etiqueta integer primary key, /*Número de identificación del libro o el elemento, único y clave primaria*/
  nombre varchar(200) not null, /*Nombre del libro o del elemento*/
  cantidadDisponible integer,   /*Si la cantidad disponible es <= 0 entonces no se puede prestar*/
  ubicacion varchar(30) not null, /*Puede ser en aulas de clase biblioteca o incluso otra sede*/
  propiedad varchar(30) not null, /*Colegio, Alcaldia, Otro*/
  responsable varchar(30) not null,/*Bibliotecólogo o docentes*/
  area varchar(30) not null, /*Area o tipo de elemento*/
  colegio varchar(30) not null /*Colegio al que pertenece el inventario*/ 	
);

create table usuarios(
   identificador varchar(40) primary key, /*Número de identificación*/   
   nombreSol varchar(40),/*Nombre del solicitante*/   
   tipo varchar(15), /*Si es estudiante o docente*/     
   cursoArea varchar (40), /*Si es estudiante se pone el curso, si es docente se pone el area del docente, si es administrador pone el cargo*/
   colegio varchar(30), /*Colegio al que pertenece el estudiante*/ 
   clave varchar(40), /*Clave creada por el usuario*/
   imagen varchar(200), /*Ruta de la imagen de Usuario*/
   correo varchar(50),
   estado varchar(50) 
);

create table reserva(
    idElemento integer,
    fechaActual date,
    fechaReserva date,
    idSol varchar(40),
    cursoArea varchar (40),
    cantidad integer,
    estado varchar, /*Activo-Terminado*/
    foreign key (idSol) references usuarios(identificador),   
    foreign key (idElemento) references inventario(etiqueta)   

);

create table prestamo(
   etiquetaInv integer, /*Clave foranea*/
   identificadorSol varchar(40),/*Clave foranea*/   
   fechaDev varchar(20),/*Fecha de devolución*/
   fechaActual varchar(20),/*Fecha en la que se pide el prestamo*/
   cantidadPrestamo integer, /*Cantidad de elementos prestados*/
   estado varchar(15),  /*Activo-Terminado*/  
   foreign key (identificadorSol) references usuarios(identificador),   
   foreign key (etiquetaInv) references inventario(etiqueta)   
);

































































